// Create a new component called Work that simply allows you to download a file './assets/Resume.docx'
import React from 'react';
import { Link } from 'react-router-dom';
// import './Work.css';

export default function Work() {
    return (
        <div className="Work">
            <h1>Work</h1>
            <p>
                <a href="./assets/Resume.docx" download>
                    Download Resume
                </a>
            </p>
            <Link to="/">Back to Home</Link>
        </div>
    );
}
